import React, {Component} from 'react';

class App extends Component{
  constructor(){
    super()
    this.state = {
      isLoggedIn:false
    }
  }
  render(){
    let word = ""
    if(this.state.isLoggedIn === true){
      word = "true"
    }
    else{
      word = "false"
    }
    return (
      <div>
          <h1>You are Currently logged {word}</h1>
      </div>
    )
  }
}


export default App;
